import React from "react";
import { Link } from "react-router-dom";


function Nav() {
  return (
<nav
    className="nav nav-tabs">
      <li className="nav-item">
        <Link to="/" >

          Home
        </Link>
      </li>
      <li className="nav-item">
        <Link to="/newstore" >

          Add New Store
        </Link>
      </li>
      </nav>

  );
}

export default Nav;
